const zigbeeHerdsmanConverters = require('zigbee-herdsman-converters');

const exposes = zigbeeHerdsmanConverters.exposes;
const ea = exposes.access;
const e = exposes.presets;
const fz = zigbeeHerdsmanConverters.fromZigbeeConverters;
const tz = zigbeeHerdsmanConverters.toZigbeeConverters;

const ptvo_switch = zigbeeHerdsmanConverters.findByDevice({modelID: 'ptvo.switch'});
fz.legacy = ptvo_switch.meta.tuyaThermostatPreset;

const device = {
    zigbeeModel: ['PZEM.3ph'],
    model: 'PZEM.3ph',
    vendor: 'Custom devices (DiY)',
    description: '[Configurable firmware](https://ptvo.info/zigbee-configurable-firmware-features/)',
    fromZigbee: [fz.ignore_basic_report, fz.ptvo_switch_analog_input, fz.on_off, fz.ptvo_multistate_action, fz.legacy.ptvo_switch_buttons,],
    toZigbee: [tz.ptvo_switch_trigger, tz.ptvo_switch_analog_input, tz.on_off],
    exposes: [e.current().withAccess(ea.STATE).withEndpoint('l1'),
      e.voltage().withAccess(ea.STATE).withEndpoint('l1'),
      e.energy().withUnit('Wh').withAccess(ea.STATE).withEndpoint('l1'),
      e.power().withAccess(ea.STATE).withEndpoint('l1'),
      exposes.numeric('frequency', ea.STATE).withEndpoint('l1').withUnit('Hz').withDescription('Frequency'),
      exposes.numeric('power_factor', ea.STATE).withEndpoint('l1').withUnit('cosf').withDescription('Power factor'),
      e.current().withAccess(ea.STATE).withEndpoint('l2'),
      e.voltage().withAccess(ea.STATE).withEndpoint('l2'),
      e.energy().withUnit('Wh').withAccess(ea.STATE).withEndpoint('l2'),
      e.power().withAccess(ea.STATE).withEndpoint('l2'),
      exposes.numeric('frequency', ea.STATE).withEndpoint('l2').withUnit('Hz').withDescription('Frequency'),
      exposes.numeric('power_factor', ea.STATE).withEndpoint('l2').withUnit('cosf').withDescription('Power factor'),
      e.current().withAccess(ea.STATE).withEndpoint('l3'),
      e.voltage().withAccess(ea.STATE).withEndpoint('l3'),
      e.energy().withUnit('Wh').withAccess(ea.STATE).withEndpoint('l3'),
      e.power().withAccess(ea.STATE).withEndpoint('l3'),
      exposes.numeric('frequency', ea.STATE).withEndpoint('l3').withUnit('Hz').withDescription('Frequency'),
      exposes.numeric('power_factor', ea.STATE).withEndpoint('l3').withUnit('cosf').withDescription('Power factor'),
  
      exposes.binary('state', ea.STATE, 'ON', 'OFF').withEndpoint('l4').withDescription('Primary source'),
      exposes.binary('state', ea.STATE, 'ON', 'OFF').withEndpoint('l5').withDescription('Secondary source')
],
    meta: {
        multiEndpoint: true,
        
    },
    endpoint: (device) => {
        return {
            l1: 1, l2: 2, l3: 3, l4: 4, l5: 5,
        };
    },
    icon: 'data:image/png;base64,',
};

module.exports = device;
